def multiple_pattern_matching(text, patterns):
    result = {}
    for pattern in patterns:
        result[pattern] = []
        start = 0
        # Find all occurrences of the pattern in the text
        while True:
            start = text.find(pattern, start)
            if start == -1:
                break
            result[pattern].append(start)
            start += 1  # Move to the next character for overlapping patterns

    # Output the result for each pattern
    with open("output.txt", "w") as file:
        for pattern in patterns:
            positions = " ".join(map(str, result[pattern]))
            file.write(f"{pattern}: {positions}\n")

